export const authInterceptorFn = (req, next) => {
  try {
    const token = localStorage.getItem('token');
    const modifiedReq = token ? req.clone({
      setHeaders: {
        Authorization: `Bearer ${token}`
      }
    }) : req;
    return next(modifiedReq);
  } catch (err) {
    console.error('Interceptor error:', err);
    return next(req);
  }
};
